import React, { Component } from 'react';

class Itemlist extends Component {
    render() {
      return (
          <div>
              <img src = {"../../images/1.jpg"} alt="item_image"/>
              <div>{this.props.name}</div>
              <div>{this.props.cost/10000}만원</div>
              <button>O</button>
              <button>X</button>
          </div>
      )
    }
  }

export default Itemlist;
